import { ChangeDetectionStrategy, Component, EventEmitter, Input, Output, ViewChild } from 'angular2/core';
import { Router, RouterLink } from 'angular2/router';
import { MODAL_DIRECTIVES, ModalComponent } from 'ng2-bs3-modal/ng2-bs3-modal';


@Component({
    changeDetection: ChangeDetectionStrategy.OnPush,
    selector: 'app-header',
    directives: [RouterLink, MODAL_DIRECTIVES],
    styles: [
        require('./app-header.scss')
    ],
    template: `
            <sidebar class="sidebar"  *ngIf="authenticated">

                  <h1 class="logo">
                    <img src="data:image/svg+xml;base64," />
                   </h1>

                  <div class="icon-search" (click)="modal.open()" style="cursor: pointer;">
                            <img src="assets/images/icon-search.png" />
                  </div>

                  <div class="search" (click)="modal.open()"></div>

                  <ul >
                    <li >
                        <a class="header__link" [routerLink]=" ['Videos'] ">
                            <img src="assets/images/icon-video.png" />
                        </a>
                    </li>
                    <li >
                        <a class="header__link" [routerLink]=" ['Repository'] ">
                             <img src="assets/images/icon-box.png" />
                        </a>
                    </li>
                    <li >
                        <a class="header__link" [routerLink]=" ['Users'] ">
                             <img src="assets/images/icon-person.png" />
                        </a>
                    </li>


                  </ul>


                  <div  class="icon-user" *ngIf="user">
                         <a class="header__link border-link" (click)="signOut.emit()" href="#">
                             <img class="img-circle" src="{{user.github.cachedUserProfile.avatar_url}}" />
                         </a>
                   </div>

                    <modal (onClose)="closed()" #modal>
                         <form class="form-search" (submit)="modal.close()">
                           <input class="input-search" autofocus  type="text" name="q" [(ngModel)]="q"  placeholder="Search Language" />
                           <button type="submit" class="btn-search"  (click)="modal.close()" ><i class="octicon octicon-search" ></i></button>
                         </form>
                    </modal>
            </sidebar>

            <div class="header" *ngIf="header">
                 <h2 *ngIf="q"> {{q}} </h2>
            </div>


          `
})

export class AppHeader {

    @Input() authenticated:boolean;
    @Output() signOut:EventEmitter<any> = new EventEmitter(false);
    @ViewChild('myModal')
    modal:ModalComponent;


    public user: any = JSON.parse(localStorage.getItem('firebase:session::browsercode'));
    public q:string = null;
    public header:boolean = true;


    constructor(private router:Router) {
        this.q = '';
    }



    closed() {
        
        window.location.href = window.location.href + "?q="+ this.q;
    }


}
